import React from "react";
import { NavLink} from "react-router-dom";
import "../App.css"
export default function Navbar() {
  return (
    <div>
      <nav>
        <li>
          <NavLink to="/">code review</NavLink>
        </li>
      </nav>
    </div>
  );
}
